import React, { useState, useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { StyledWrapper, StyledHeader, StyledButton, nextButton } from "./Style.jsx"
import ViewForm from "./ViewForm.jsx";

function ResponseDisplay() {

  let { id } = useParams()
  console.log(sid)
  const navigate = useNavigate()

  const forms = []
  forms.push(ViewForm(id))

  return (
    <div>
      <button onClick={() => { navigate("/Home") }}>Home</button>
      <div align="center">
      <StyledHeader>Responses</StyledHeader>
      <button onClick={() => { navigate(`/Result/${id - 1}`) }}>Prev</button>
      <button onClick={() => { navigate(`/Result/${id + 1}`) }}>Next</button>
      </div>
      <StyledWrapper>
        <div>{forms}</div>
      </StyledWrapper>
    </div>
  )
}

export default ResponseDisplay
